import React, { useEffect, useState } from 'react';
import FetchEventsTurku from '../api/FetchEventsTurku';

export default function ListImages() {
  const [myEvents, setAllEvents] = useState<any>("")

  const allEvents = async (page: number) => {

    const res: any = await FetchEventsTurku(page);
    console.log(res.status);
    console.log(res.data);
    console.log(res.data.data);
    setAllEvents(res.data.data);
  }

  useEffect(() => {
    allEvents(1);
  }, [])

  return (
    <div className="col-lg-6 col-md-12">
      <div className="card card-chart">
        <div className="card-header ">
          <div className="row d-flex ">
            <h1> LOL</h1>
            {myEvents &&
              myEvents.map((event: any, i: number) =>
                (<div className="list-group-flush" key={i}>
                  {/* <div className="list-group-item"> */}
                  <p className="mb-0">
                    {event.images.length > 0 ? 
                    <img className="mr-4  p-3 rounded " src={event.images[0].url} alt="event" /> 
                    : 'no Image'}
                    {event.name ? event.name.fi : 'no name'}
                    {event.id}
                    {event.end_time}
                    {event.description}
                  </p>
                  {/* </div> */}
                </div>)
              )
            }
          </div>
        </div>
      </div>
    </div>
  )
}


